import "./App.css";
import React from "react";
import Header from "./Header.js";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Footer from "./Footer";
import Match from "./Match";
function App() {
  return (
    <Router>
      <Routes>
        <Route
          path="/matchscouting"
          element={
            <>
              <Header name="Match Scouting" />
              <Match />
              <Footer />
            </>
          }
        ></Route>
      </Routes>
    </Router>
  );
}

export default App;
